import React, { Component } from 'react';
import Header from '../Common/Header';

import image from '../assests/img/MI-Teaser.png'

class About extends Component {
    render() {
        return (
          <div>
            
            
            <Header
              title="About Us!"
              subtitle="It's really a great story"
              showButton={false}
              image={image}
            />
           
           </div>
        );}
 }
                           
export default About;
